        public long IsPalindrom2(string value)
        {
            char[] chars = value.ToCharArray();
            long size = chars.Length - 1;
            long avg = size / 2;

            for (long i = 0; i < avg; i++)
            {
                if (chars[i] != chars[size - i])
                {
                    if (chars[i + 1] != chars[size - i])
                        return i;

                    if (chars[i] != chars[size - i - 1])
                        return size - i;
                }
            }

            return -1;
        }

        public long IsPalindrom(string value)
        {
            long left = 0;

            char[] chars = value.ToCharArray();
            long right = chars.LongLength - 1;
            //bool flag = false;

            while (left < right)
            {
                if (chars[left] != chars[right])
                {
                    if (chars[left + 1] == chars[right] )//&& chars[left + 2] == chars[right - 2])
                        return left++;

                    if (chars[left] == chars[right - 1])
                        return right--;
 
                }

                left++;
                right--;
            }

            if (left > right)
                return left;

            return -1;
        }

        public long IsPalindrom3(string value)
        {
            long left = 0;

            char[] chars = value.ToCharArray();
            long right = chars.LongLength - 1;

            while (left < right)
            {
                if (chars[left] != chars[right])
                {
                    if (chars[left + 1] == chars[right])
                    {
                        for (long i = left +1, j = right; i < j; i++, j--)
                        {
                            if (chars[i] != chars[j])
                                return right;
                        }

                        return left;
                    }
                    
                    if (chars[left] == chars[right - 1])
                        return right--;

                }

                left++;
                right--;
            }

            if (left >= right)
                return left;
            else
